.info__phone {
  position: relative;
  width: 24px;
  height: 24px;
  margin-right: 63px;

  @include forMobile {
    width: 18px;
    height: 18px;
  }

  &::before {
    content: "+1 212-535-7710";
    max-width: 160px;
    color: #fff;
    padding-right: 12px;
    font-weight: 700;
    font-size: 1rem;
    opacity: 0;
  }

  &:hover::before {
    opacity: 1;
  }
}

.info__bar {
  width: 24px;
  height: 5px;
  background-color: #fff;
  border-radius: 2px;
  position: relative;

  @include forMobile {
    width: 18px;
    height: 2px;
  }

  &::before {
    content: "";
    width: 24px;
    height: 5px;
    background-color: #fff;
    border-radius: 2px;
    position: absolute;
    top: -8px;

    @include forMobile {
      height: 2px;
      width: 18px;

      top: -8px;
    }
  }

  &::after {
    content: "";
    width: 24px;
    height: 5px;
    background-color: #fff;
    border-radius: 2px;
    position: absolute;
    top: 8px;

    @include forMobile {
      height: 2px;
      width: 18px;

      top: 0;
    }
  }
}

