      grid-column: 4 / 7;

      @include forTablet {
        grid-column: 1 / 4;

        margin-top: 48px;
      }

      @include forMobile {
        grid-column: 1 / -1;
      }

      &__title {
        font-weight: 700;
        font-size: 16px;
        color: #161616;
      }

      &__phone,
      &__address-text {
        font-weight: 400;
        font-size: 14px;
        color: #161616;
      }

      &__number {
        font-weight: 700;
        font-size: 16px;
        color: #3e3e3e;
        text-decoration: none;
      }

      &__address {
        font-weight: 700;
        font-size: 16px;
        color: #3e3e3e;
        text-transform: uppercase;
        text-decoration: none;
      }
    }

    .col-3 {
      grid-column: 8 / -1;

      @include forTablet {
        grid-row: 1 / 3;
        grid-column: 4 / -1;
      }

      @include forMobile {
        grid-row: 3;
        grid-column: 1 / -1;
      }
    }

    .contact__name,
    .contact__email,
    .contact__message,
    .contact__send-button {
      display: block;
      width: 100%;
      margin-top: 27px;
      border-color: transparent;
      box-sizing: border-box;
    }

    .contact__name {
      background: #f8f8fa;
      height: 48px;
      font-family: "Cinzel", sans-serif;
      padding: 14px 16px;
      color: #161616;

      &::placeholder {
        font-family: "Cinzel", sans-serif;
        font-weight: 400;
        font-size: 14px;
        color: #7e7e83;
      }

      &:hover {
        background: #f8f8fa;
        border: 1px solid #d5d7de;
        cursor: pointer;
      }

      &:hover::placeholder {
        color: #161616;
      }

      &:focus {
        outline: none;
      }
    }

    .contact__send-button {
      height: 56px;
      font-family: "Cinzel", sans-serif;
      font-weight: 700;
      font-size: 16px;
      text-align: center;
      color: #fff;
      background: #d12d35;

      &:hover {
        cursor: pointer;
        background: #ae1c23;
      }

      &:active {
        background: #eb343d;
      }
    }

    .contact__email {
      background: #f8f8fa;
      height: 48px;
      font-family: "Cinzel", sans-serif;
      padding: 14px 16px;
      color: #161616;

      &::placeholder {

        font-weight: 400;
        font-size: 14px;
        color: #7e7e83;
      }

      &:hover {
        background: #f8f8fa;
        border: 1px solid #d5d7de;
        cursor: pointer;
      }

      &:hover::placeholder {
        color: #161616;
      }

      &:focus {
        outline: none;
      }
    }

    .contact__message {
      font-family: "Cinzel", sans-serif;
      font-weight: 400;
      font-size: 14px;
      color: #7e7e83;
      padding: 14px 16px;
      background: #f8f8fa;

      &:hover {
        background: #f8f8fa;
        color: #161616;
        border: 1px solid #d5d7de;
        cursor: pointer;
      }

      &:focus {
        outline: none;
      }
    }
  }
}

